import { EmailSharp } from "@material-ui/icons";

const TextFormField = ({ lable, icon }) => {
  return (
    <TextField
      id="input-with-icon-textfield"
      label={lable}
      InputProps={{
        startAdornment: <InputAdornment position="start">icon</InputAdornment>,
      }}
      variant="standard"
    />
  );
};

